import React from 'react'
import Wave from '../../assets/wave.svg';

const Home = () => {
  return (
    <> 
      <h1 className="text-center" style={{paddingTop: "30%"}}>
        <img src={Wave} alt="" />
      </h1>
    </>
    
  )
}
export default Home;
